import React from 'react';
import video from "./wallpaper.mp4"


const HomePage = () => {
  return (
    <div className="hpContainer">
      <div className="videoContainer">
      <video src={video} width="100%" height="10%" autoplay="true" muted />
      </div>
    </div>
  );
};

export default HomePage;
